INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, "リリ", 2, 125801, 1, 1, 40011, 321, 24001, 1);
