INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, "クリア", 2, 126001, 5, 1, 40011, 325, 24001, 2);
